import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";


function TableRow({ rowData }) {
  const [isOpen, setIsOpen] = useState(false);

  const toggleButtons = () => {
    setIsOpen(!isOpen);
  };

  return (
    <tr>
      <td>{rowData.name}</td>
            <td>{rowData.calories}</td>
            <td>{rowData.protein}</td>
            <td>{rowData.carbs}</td>
            <td>{rowData.fat}</td>
      <td>
        <button className='btn btn-dark' onClick={toggleButtons}>Add to a Meal</button>
            {isOpen && (
      <div>
        <button className="btn btn-secondary"  type="button" onClick>Breakfast</button>
        <button className="btn btn-secondary"  type="button" onClick>Lunch</button>
        <button className="btn btn-secondary" type ='button' onClick>Dinner</button>
      </div>
    )}</td>
    </tr>
  );
}

function FoodTable() {
  const [searchTerm, setSearchTerm] = useState("");
  const [searchResults, setSearchResults] = useState([]);


  const mockData = [
      { name: "Apple", protein: 0.3, carbs: 25, fat: 0.4, calories: 200 },
      { name: "Banana", protein: 1.3, carbs: 27, fat: 0.4, calories: 200},
      { name: "Chicken Breast", protein: 31, carbs: 0, fat: 3.6, calories: 200 },
      {name: "Apple-Pink Lady", protein:0.2, carbs: 23, fat: 0.4, calories: 200}
    ];


  const handleSearch = async () =>  {
    try {
      if (searchTerm.trim() === '') {
        setSearchResults([]);
      }
      else {
        const searchTermLower = searchTerm.toLowerCase();
        const data = await fetch(`http://localhost:8000/food/${searchTermLower}`)
        if (data.ok) 
          setSearchResults(data.json())
        else
          console.error('Could not get the foods',data.statusText)

       // const searchResults = mockData.filter((food) => 
       // food.name.toLowerCase().includes(searchTerm.toLowerCase())
       // );
      }
    }
    catch(error){

    }

  };


  return (
    <div className="container mt-4">
      <div className="input-group mb-3">
        <input
          type="text"
          className="form-control"
          placeholder="Search for foods"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <div className="input-group-append">
          <button
            className="btn btn-dark"
            type="button"
            onClick={handleSearch}
          >
            Search
          </button>
        </div>
      </div>
      <div>
      <table className="table">
        <thead className="thead-dark">
          <tr>
            <th>Name</th>
            <th>Calories (100g)</th>
            <th>Protein (100g)</th>
            <th>Carbs (100g)</th>
            <th>Fat (100g)</th>
          </tr>
        </thead>
        <tbody>
        {searchResults.map((food,index)=>(
          <tr key={index}>
             <td>{food.name}</td>
            <td>{food.calories}</td>
            <td>{food.protein}</td>
            <td>{food.carbs}</td>
            <td>{food.fat}</td>
          </tr>
        ))}
        </tbody>
      </table>
      </div>
    </div>
  );
}

export default FoodTable;
